import React from 'react';
import "./navbody.scss";

const Navbody = () => {
    return (
        <div className="containerNavBody">
            <div className="itemNavbody-left">
                <div className="itemNavbody-left--avatar">
                </div>
            </div>
            <div className="itemNavbody-right">
            </div>
        </div>
    );
}

export default Navbody;
